import React from 'react';
import cssClasses from './home.module.scss'
import Link from 'next/link'
import styled from 'styled-components'

const RedLink = styled.a`
  color: red;

`

const App = () => {
    return <div className={cssClasses.Joblers}>
        <h1 className={cssClasses.Joblers__title}>Hello NextJs</h1>
        <Link href="/docs/1" passHref>
            <RedLink>Docs</RedLink>
        </Link>

    </div>
}

export default App;
